import { useState } from "react"

const NewOne=()=>{

    const[event,setEvent]=useState({
            eventId:0,
            eventName:"",
            eventStarted:"",
            eventEnded:"",
            eventExpert:"",
            eventVenue:"",
            eventDuration:0,
            eventParticipants:0,
            eventStatus:false
    })

    const hey=(e)=>{
        const{name,value}=e.target
        setEvent((old)=>{
            return{
                ...old,
                [name]:value
            }
        })
    }

    const sub=()=>{

    }

    const cls=()=>{
        setEvent(()=>{
            return{
                eventId:0,
                eventName:"",
                eventStarted:"",
                eventEnded:"",
                eventExpert:"",
                eventVenue:"",
                eventDuration:0,
                eventParticipants:0,
                eventStatus:false
            }
        })
    }

    return(<>
        <div className="container">
            <div className="row justify-content-center">
                <div className="col">
                    <input type="text" placeholder="Event Name" name="eventName" value={event.eventName} onChange={hey} className="form-control"/>
                    <input type="text" placeholder="Event Started" name="eventStarted" value={event.eventStarted} onChange={hey} className="form-control"/>
                    <input type="text" placeholder="Event Ended" name="eventEnded" value={event.eventEnded} onChange={hey} className="form-control"/>
                    <input type="text" placeholder="Event Name" name="eventExpert" value={event.eventExpert} onChange={hey} className="form-control"/>
                    <input type="text" name="eventVenue" value={event.eventVenue} onChange={hey} className="form-control"/>
                    <input type="text" name="eventDuration" value={event.eventDuration} onChange={hey} className="form-control"/>
                    <div className="row justify-content-around">
                        <input type="button" className="col-3 btn btn-primary" onClick={sub} value="Insert" />
                        <input type="button" className="col-3 btn btn-primary" onClick={cls} value="Clean" />
                    </div>
                </div>
            </div>
        </div>
    </>)
}

export default NewOne
